\section*{Results}

This section presents the comprehensive experimental results of the A* algorithm performance evaluation across four distinct scenarios. A total of 200 test cases were executed, with detailed analysis of search time, node expansion, path length, and success rates under varying environmental conditions.

\subsection*{Scenario A: Impact of Map Size on Algorithm Performance}

The first scenario investigates how the computational complexity of A* scales with increasing problem space dimensions. Five map sizes were tested: 10×10, 20×20, 50×50, 100×100, and 200×200, with each configuration repeated 10 times to ensure statistical reliability.

\begin{figure}[h]
\centering
\includegraphics[width=0.9\textwidth]{figures/figure_1_mapsize_impact.png}
\caption{Impact of map size on A* algorithm performance. The dual-axis chart shows search time (left axis, blue line) and expanded nodes (right axis, red line) as functions of map dimensions. Search time increases from approximately 0.05 ms for 10×10 maps to 1.64 ms for 200×200 maps, while expanded nodes grow from 9.4 to 479.7. This exponential growth pattern demonstrates the computational complexity inherent in larger search spaces.}
\label{fig:mapsize}
\end{figure}

The results reveal a clear exponential relationship between map size and both search time and node expansion. For the smallest map (10×10), the algorithm achieved an average search time of 0.049 ms with 9.4 expanded nodes. As the map size increased to 200×200, the search time escalated to 1.641 ms with 479.7 expanded nodes on average. This 33-fold increase in search time and 51-fold increase in node expansion illustrates the fundamental computational challenges of pathfinding in larger environments. The consistent performance characteristics across all map sizes indicate that the algorithm maintains its efficiency properties despite the increased problem complexity.

\subsection*{Scenario B: Heuristic Function Comparison}

The second scenario evaluates the critical impact of heuristic function selection on algorithm efficiency. Three commonly used heuristic functions were compared on a standardized 50×50 map with 20\% obstacle density:

\begin{itemize}
\item Manhattan Distance: Calculates the sum of absolute differences in coordinates
\item Euclidean Distance: Computes the straight-line distance between points
\item Diagonal Distance: Accounts for diagonal movement in grid-based pathfinding
\end{itemize}

\begin{figure}[h]
\centering
\includegraphics[width=0.9\textwidth]{figures/figure_2_heuristic_comparison.png}
\caption{Comparison of three heuristic functions in A* algorithm. The grouped bar chart displays the average number of expanded nodes for each heuristic function. Manhattan distance achieves the best performance with 40.0 nodes, followed by Euclidean distance with 153.7 nodes, and diagonal distance with 244.1 nodes. These results validate the theoretical understanding that more consistent heuristics lead to superior search efficiency.}
\label{fig:heuristic}
\end{figure}

The experimental results demonstrate a dramatic performance difference among the three heuristic functions. Manhattan distance proved to be the most efficient, expanding only 40.0 nodes on average with a search time of 0.151 ms. Euclidean distance expanded 153.7 nodes (3.8 times more than Manhattan), while diagonal distance expanded 244.1 nodes (6.1 times more than Manhattan). These findings strongly support the theoretical principle that admissible heuristics with higher consistency values significantly reduce the search space exploration. The Manhattan distance's superior performance on grid-based environments confirms its suitability for this class of pathfinding problems.

\subsection*{Scenario C: Impact of Obstacle Density on Algorithm Robustness}

The third scenario examines how environmental constraints affect algorithm performance and reliability. Obstacle densities ranging from 0\% to 50\% were tested on 50×50 maps, with each configuration repeated 10 times.

\begin{figure}[h]
\centering
\includegraphics[width=0.9\textwidth]{figures/figure_3_obstacle_impact.png}
\caption{Impact of obstacle density on A* algorithm performance. The dual-axis chart shows search time (left axis, blue line) and success rate (right axis, green line) as functions of obstacle density. Search time remains relatively stable (0.11-0.43 ms) across densities from 0\% to 40\%, while success rate decreases from 100\% at lower densities to 90\% at 50\% obstacle density. This demonstrates the algorithm's robustness in constrained environments.}
\label{fig:obstacle}
\end{figure}

The results indicate that A* maintains remarkable robustness across varying obstacle densities. At 0\% obstacle density, the algorithm achieved a 100\% success rate with an average search time of 0.114 ms. As obstacle density increased to 50\%, the search time increased to 0.153 ms, representing only a 34\% increase despite the significantly more constrained environment. The success rate remained at 100\% for obstacle densities up to 40\%, declining to 90\% only at the extreme 50\% density level. This single failure case at 50\% density indicates that certain configurations create unsolvable scenarios where no path exists between start and goal positions. Overall, the algorithm demonstrates excellent performance stability and reliability even in highly constrained environments.

\subsection*{Scenario D: Relationship Between Path Length and Search Efficiency}

The fourth scenario investigates the correlation between target distance and computational requirements. Path lengths were categorized into four distance ranges: short (distance 10), medium (distance 20), long (distance 30), and very long (distance 40+).

\begin{figure}[h]
\centering
\includegraphics[width=0.9\textwidth]{figures/figure_4_distance_efficiency.png}
\caption{Relationship between path length and search efficiency in A* algorithm. The dual-axis chart displays search time (left axis, blue line) and expanded nodes (right axis, orange line) as functions of target distance. Search time increases linearly from 0.079 ms for short paths to 0.223 ms for very long paths, while expanded nodes increase from 18.7 to 55.9. The linear relationship validates the theoretical understanding of A* efficiency in pathfinding tasks.}
\label{fig:distance}
\end{figure}

The experimental results reveal a strong linear relationship between path length and computational cost. For short paths (distance 10), the algorithm expanded an average of 18.7 nodes with a search time of 0.079 ms. As path length increased to very long distances (40+), the algorithm expanded 55.9 nodes with a search time of 0.223 ms. This approximately 3-fold increase in both metrics demonstrates the predictable and efficient scaling of A* with solution path length. The linear relationship validates the theoretical foundation of A* algorithm, confirming that computational cost scales proportionally with the solution path length rather than exponentially with problem space size.

\subsection*{Performance Metrics Summary}

A comprehensive summary of key performance indicators across all four scenarios is presented in Figure~\ref{fig:summary}. This table provides a quick reference for comparing algorithm performance under different experimental conditions.

\begin{figure}[h]
\centering
\includegraphics[width=0.9\textwidth]{figures/figure_5_performance_table.png}
\caption{Performance metrics summary table across all experimental scenarios. The table compares average search time, expanded nodes, path length, and success rate for each scenario. Scenario A (200×200 map) shows the highest metrics due to larger problem space, while Scenarios B, C, and D demonstrate consistent performance on 50×50 maps. The data confirms that heuristic choice has the most significant impact on node expansion efficiency, while obstacle density and path length have minimal effects on overall performance.}
\label{fig:summary}
\end{figure}

The summary table reveals several important insights:

\begin{itemize}
\item \textbf{Scenario A (Map Size):} Average search time of 1.641 ms with 479.7 expanded nodes, reflecting the computational demands of large-scale pathfinding
\item \textbf{Scenario B (Heuristic):} Average search time of 0.151 ms with 40.0 expanded nodes, demonstrating the efficiency of optimal heuristic selection
\item \textbf{Scenario C (Obstacle Density):} Average search time of 0.153 ms with 43.1 expanded nodes, showing stable performance across environmental constraints
\item \textbf{Scenario D (Path Length):} Average search time of 0.155 ms with 38.9 expanded nodes, confirming efficient scaling with solution path length
\end{itemize}

Across all 200 test cases, the algorithm achieved a 99.5\% success rate (199 successful paths found), with an overall average search time of 0.275 ms and an average of 150.4 nodes expanded per test case. These results comprehensively validate the effectiveness and reliability of the A* algorithm for grid-based pathfinding applications across diverse environmental conditions and problem configurations.

